import { FC } from "react"
import { Cell } from "../models/Cell"


interface CellProps {
    cell: Cell;
    celected: boolean;
}

const CellComponent: FC<CellProps> = ({cell, celected}) => {

    return (
        <div
            className={['cell', cell.color].join(' ')}
        >

            {cell.figure?.logo && <img src={cell.figure.logo} alt="" />}

        </div>

    )
}


export default CellComponent
